      <Html lang="en">
        <Head>
          <meta charSet="UTF-8" />
          <meta
            name="viewport"
            content="width=device-width, initial-scale=1.0"
          />
          <link rel="shortcut icon" href="favicon.ico" />
          <link rel="stylesheet" href="/css/nprogress.css" />
        </Head>{" "}
        <body>
          <Main />
          <NextScript />
        </body>{" "}
      </Html>
    );
  }
}

export default MyDocument;
